function App() {
  return (
    <Router>
      <Navbar/>

      <Routes path="/">
      //Home
      </Routes>

      <Routes path="/tracks">
      //Tracks
      </Routes>

      <Routes path="/search">
      //Search Tracks
      </Routes>

    </Router>
  )
}

export default App;
